display:flex;
flex-direction:column;
position: absolute;
align-items:center;
width: 1512px;
height: 6723px;
top: 1290px;`

const Data=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
margin:50px;
gap: 40px;
`
const DataBlock=styled.div`
width: 256px;
height: 160px;
display: flex;
flex-direction:column;
gap:10px;
align-items: center;
