color: #67718E;
z-index: 1;
`

const VideoHead=styled.div`
position: absolute;
width: 721px;
height: 56px;
left: 0px;
top: 95px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 48px;
line-height: 56px;
letter-spacing: -1.44px;
color: #061237;`

const Video=styled.div`
position: absolute;
width: 992px;
height: 550px;
left: 0px;
top: 208px;
`

const Div1=styled.div`
