top: 404.5px;
z-index:-1;
`
const VideoDesc=styled.div`
position: absolute;
width: 525.87px;
height: 108px;
right: 18.13px;
top: 789px;

font-family: 'Inter';
font-style: normal;
font-weight: 400;
font-size: 18px;
line-height: 200%;
display: flex;
align-items: center;
letter-spacing: -0.18px;
color: #37456C;
`
const Explore=styled.div`
display: flex;
flex-direction: row;
align-items: flex-start;
padding: 0px;
gap: 42px;
position: absolute;
width: 1120px;
height: 600px;
left: 196px;
top: 1548px;`

const Left=styled.div`
width: 588px;
height: 600px;
`
